import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
 border: solid 5px white;
 color: white;
`

const Movie = ({movie}) => {

 return (
  <Wrapper>
   <h1>{movie.title}</h1>

  </Wrapper>
 )
}

export default Movie
